function createText() {
	// console.log(logoData.logoData, activeIndex);
	var t0 = performance.now();
	var scope = this;
	for (var i = 0; i < 28; i++) {
		scope.manager.itemStart(logoData.logoData[i].title);
	}
	logoData.logoData.forEach(function (item, i) {

		var year = item.year;
		var title = item.title;
		var desc = item.desc;

		var textYearGeo = new THREE.TextGeometry(year, {
			font: font,
			size: 60,
			height: 1,
			curveSegments: 12,
			bevelEnabled: false,
			bevelThickness: 5,
			bevelSize: 1,
			bevelSegments: 5
		});

		textMaterial = new THREE.MeshBasicMaterial({
			color: 0x10ff10,
			transparent: true,
			opacity: 1
		});

		// Calculate center position
		textYearGeo.center();
		yearMeshes[i] = new THREE.Mesh(textYearGeo, textMaterial);
		yearMeshes[i].position.set(0, 0, 1);

		var textTitleGeo = getCenteredGeometry(title, 20);

		var textDescGeo = getCenteredGeometry(desc, 10);

		// Merge geometries and center
		textDescGeo.translate(0, textTitleGeo.boundingBox.min.y + textDescGeo.boundingBox.min.y - 20, 0);

		var titleDescGeo = new THREE.Geometry();
		titleDescGeo.merge(textTitleGeo);
		titleDescGeo.merge(textDescGeo);
		titleDescGeo.center();
		titleDescMeshes[i] = new THREE.Mesh(titleDescGeo, textMaterial);
		titleDescMeshes[i].position.set(0, 0, 1);

		hideTextMeshes(i);
		scope.manager.itemEnd(item.title);
	});
	var t1 = performance.now();
	console.log('Time taken for createText: ' + (t1 - t0) + 'ms');
}

function showTextMeshes(i) {
	titleDescMeshes[i].visible = true;
	yearMeshes[i].visible = true;
}

function hideTextMeshes(i) {
	titleDescMeshes[i].visible = false;
	yearMeshes[i].visible = false;
}

// Create multiline text geometries and merge them
function getCenteredGeometry(text, fontSize) {
	var newtext = text.split('\n');
	var geos = [];
	var newgeo = new THREE.Geometry();
	newtext.forEach(function (item, i) {
		geos[i] = new THREE.TextGeometry(item, {
			font: font,
			size: fontSize,
			height: 1,
			curveSegments: 12,
			bevelEnabled: false,
			bevelThickness: 5,
			bevelSize: 1,
			bevelSegments: 5
		});
		geos[i].center();
		geos[i].translate(0, -(fontSize + 10) * i, 0);
		newgeo.merge(geos[i]);
	});
	newgeo.center();
	return newgeo;
}

